// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "./ITimelockPolicy.sol";

/* Ensures that pre-sale tokens are locked for 12 months = 360 days */
contract PreSaleTimelockPolicy is ITimelockPolicy 
{
    /**
    * @dev Get the relative amount of unlocked tokens for a passed time period.
    *
    *
    * @param lockedTime The time since the tokens have been locked
    *
    * @return unlockedPercentage The percentage, either 0 or 100. 0 if tokens haven't been locked for 12 months yet.
    */
    function getUnlockedPercentage(uint256 lockedTime) override public pure returns (uint8 unlockedPercentage)
    {
        uint maxLockTime = 31104000; // 60 sec * 60 min * 24 hrs * 30 days * 12 months

        if(lockedTime < maxLockTime)
        {
            unlockedPercentage = 0;
        }
        else
        {
            unlockedPercentage = 100;
        }
    }
}

